from math import gcd
from itertools import islice
def agen(): # generator of terms
    aset, b, c, d = {1, 2, 3, 5}, 2, 3, 5
    yield from [1, b, c, d]
    while True:
        k = 1
        while k in aset or any(gcd(t, k) != 1 for t in [b, c, d]): k+= 1
        b, c, d = c, d, k
        aset.add(k)
        yield k
